import React from 'react'
import {Link } from 'react-router-dom'

const Card = ({data}) => {
  return (
    <>
    {data.map((card, index)=>{
        return(
        <div key={card.id} className="card">
            <h1>{card.name}</h1>
            <p>{card.website}</p>
            <Link to={`/cards/${card.id}`}>More</Link>
        </div>
        )
    })
    };
    </>
  )
}

<div className="col-lg-3">
        
<div className="card" ky={card.id} >
  <div className="card-body">
    <h1 className="card-name">{card.name[0]}</h1>
    <h5 className="card-title">{card.name}</h5>
    <h5 className="card-title">@{card.cardname}</h5>
    <h5 className="card-title">https://{user.website}</h5>
    </div>
    </div>
    </div>


export default Card
